import React from 'react';
import Tilt from 'react-tilt'
import brain from './brain.gif'

const Logo =()=>{

	return(

		<Tilt className="Tilt br2 shadow-2" options={{ max : 55 }} style={{ height: 150, width: 200 }} >
		 	<div className="Tilt-inner"><img style={{paddingTop:'5px'}} alt='logo' src='{brain}'/> </div>
		</Tilt>

		);
}

export default Logo;
